description:
Keith's comedy music band Lewberger is in the studio for a quick mini podcast before the episode. Be sure to tune in to NBC's Bring the Funny to watch them compete. Then, the guys go head to head in a Shark Tank style battle of business ideas. Keith's involves giant bugs.
